import Container from "react-bootstrap/esm/Container";
import logo from "./agile_logo.jpg";
import Navbar from "react-bootstrap/Navbar";

export default function Footer() {
  return (
    <footer>
      <Navbar>
        <Container>

        </Container>
        <img src={logo} width="50" height="50" />
      </Navbar>
    </footer>
  );
}
